	"cpapp/cpassignnode/view/ItemDetail.view.xml":'<mvc:View xmlns:mvc="sap.ui.core.mvc"\n    xmlns="sap.m"\n    xmlns:f="sap.ui.layout.form" controllerName="cpapp.cpassignnode.controller.ItemDetail"\n    xmlns:html="http://www.w3.org/1999/xhtml" class="ItemMaster"><Page id="idClassChar" ><customHeader><Toolbar height="50%"><Title id="struTitle" text="BOM-Structure Nodes" class="ClassHead"></Title><ToolbarSpacer/><Button text="Assign" press="onAssign" tooltip="Assign Structure Node"/></Toolbar></customHeader><content><Toolbar height="8%"><VBox><HBox><Text text="{i18n>loc} : " class="boldText"></Text><Text text=" {oGModel>/SelectedLoc}"></Text><ToolbarSpacer/></HBox><HBox><Text text="{i18n>prod} : " class="boldText"></Text><Text text=" {oGModel>/SelectedProd}"></Text></HBox></VBox></Toolbar><Table id="sturList" items="{path: \'/results\'}" mode="SingleSelectMaster"><columns><Column hAlign="Center"><Text text="Item #" /></Column><Column hAlign="Center"><Text text="Component"/></Column><Column hAlign="Center"><Text text="Component Qty" /></Column><Column hAlign="Center"><Text text="Structure Node" /></Column><Column hAlign="Right"><Text text="" /></Column></columns><items><ColumnListItem><cells><Text text="{ITEM_NUM}" /><Text text="{COMPONENT}" /><Text text="{COMP_QTY}" /><Text text="{STRUC_NODE}" /><Button icon="sap-icon://decline" tooltip="Delete" press="onStructureNodeDel" \n                                    iconDensityAware="false" type="Transparent"/></cells></ColumnListItem></items></Table></content></Page></mvc:View>',
	"cpapp/cpassignnode/view/ItemMaster.view.xml":'<mvc:View xmlns:mvc="sap.ui.core.mvc"\n    xmlns="sap.m" controllerName="cpapp.cpassignnode.controller.ItemMaster"\n    xmlns:html="http://www.w3.org/1999/xhtml" class="ItemMaster"><Page ><customHeader><Toolbar height="50%"><SearchField id="headSearch" liveChange="onSearch" placeholder="Product/ Location"/><ToolbarSpacer/><Button icon="sap-icon://add" press="onAccNode" tooltip="Add Access Node"/><Button icon="sap-icon://delete" press="onAccNodeDel" tooltip="Delete Access Node"/></Toolbar></customHeader><content><List\n\t\tid="accessList"\n\t\tmode="SingleSelectMaster"\n\t\tdelete="onAccNodeDel"\n        itemPress="onhandlePress"\n        selectionChange="onhandlePress"\n\t\tenableBusyIndicator="true"\n\t\theaderText="Products"\n\t\tgrowing="true"\n\t\titems="{\n\t\t\tpath: \'/results\'\n\t\t}" ><StandardListItem\n\t\t\ttitle="{PRODUCT_ID}"\n\t\t\tdescription="{LOCATION_ID}"\n            info="{ACCESS_NODE}" /></List></content></Page></mvc:View>',
	"cpapp/cpassignnode/view/LocDialog.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core"><SelectDialog id="LocSlctList" title="{i18n>loc}" search="handleSearch" liveChange="handleSearch" rememberSelections="false"\n\t\tconfirm="handleSelection" cancel="handleClose" items="{/results}"><StandardListItem title="{LOCATION_ID}" description="{LOCATION_DESC}" type="Active"/></SelectDialog></core:FragmentDefinition>',
	"cpapp/cpassignnode/view/ProdDialog.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core"><SelectDialog id="prodSlctList" title="{i18n>prod}" rememberSelections="true" search="handleSearch" liveChange="handleSearch"\n\t\tconfirm="handleSelection" cancel="handleClose"  contentWidth="320px" items="{/results}" \n        selectionChange="handleProdChange" growing="false"><StandardListItem title="{PRODUCT_ID}" description="{PROD_DESC}" type="Active"/></SelectDialog></core:FragmentDefinition>',
	"cpapp/cpassignnode/view/StructureNodes.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:mvc="sap.ui.core.mvc" displayBlock="true" xmlns:l="sap.ui.layout"\n\txmlns:f="sap.ui.layout.form" xmlns:u="sap.ui.unified"><SelectDialog id="sturList" title="Structure Nodes" search="handleStruSearch" liveChange="handleStruSearch" rememberSelections="false"\n\t\tconfirm="handleStruSelection" cancel="handleClose" items="{/results}"><StandardListItem title="{CHILD_NODE}" description="{NODE_DESC}" type="Active"/></SelectDialog></core:FragmentDefinition>',
	"cpapp/cpassignnode/view/ViewNodes.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:mvc="sap.ui.core.mvc" displayBlock="true" xmlns:l="sap.ui.layout"\n\txmlns:f="sap.ui.layout.form" xmlns:u="sap.ui.unified"><Dialog  title="" contentWidth="450px"><VBox class="sapUiSmallMargin"><f:SimpleForm id="SimpleFormToolbar" editable="true" layout="ResponsiveGridLayout" labelSpanXL="3" labelSpanL="3" labelSpanM="3"\n\t\t\t\tlabelSpanS="3" adjustLabelSpan="false" emptySpanXL="0" emptySpanL="0" emptySpanM="0" emptySpanS="0" columnsXL="2" columnsL="1" columnsM="1"\n\t\t\t\tsingleContainerFullSize="false"><f:content><Label text="{i18n>struNode}"/><Input id="idStruNode" value="" width="100%"/><Label text="{i18n>strudesc}"/><Input id="idStruDesc" value="" width="100%"/></f:content></f:SimpleForm></VBox><buttons><Button id="saveButton" type=\'Ghost\' text="{i18n>save}" press="onStruNodeSave"></Button><Button type=\'Reject\' text="{i18n>close}" press="onStruNodeClose"></Button></buttons></Dialog></core:FragmentDefinition>'
